–í–æ—Ç –ø—Ä–æ—Å—Ç–µ–π—à–∏–π –¥–µ–º–æ–Ω—Å—Ç—Ä–∞—Ü–∏–æ–Ω–Ω—ã–π –ø—Ä–∏–º–µ—Ä "–Ω–µ–π—Ä–æ–Ω–∞" llm:
import numpy as np

class Neuron:
    """
    –ü—Ä–æ—Å—Ç–µ–π—à–∞—è –º–æ–¥–µ–ª—å –Ω–µ–π—Ä–æ–Ω–∞: –≤—ã—á–∏—Å–ª—è–µ—Ç –≤–∑–≤–µ—à–µ–Ω–Ω—É—é —Å—É–º–º—É –≤—Ö–æ–¥–æ–≤ —Å –¥–æ–±–∞–≤–ª–µ–Ω–∏–µ–º —Å–º–µ—â–µ–Ω–∏—è –∏ –ø—Ä–∏–º–µ–Ω—è–µ—Ç –∞–∫—Ç–∏–≤–∞—Ü–∏—é.
    """
    def __init__(self, input_size, activation='relu'):
        # –ò–Ω–∏—Ü–∏–∞–ª–∏–∑–∞—Ü–∏—è –≤–µ—Å–æ–≤ –∏ —Å–º–µ—â–µ–Ω–∏—è (bias)
        self.weights = np.random.randn(input_size)
        self.bias = np.random.randn()
        # –í—ã–±–æ—Ä —Ñ—É–Ω–∫—Ü–∏–∏ –∞–∫—Ç–∏–≤–∞—Ü–∏–∏
        if activation == 'relu':
            self.activation = self._relu
        elif activation == 'sigmoid':
            self.activation = self._sigmoid
        else:
            raise ValueError(f"Unknown activation: {activation}")

    def _relu(self, x):
        return np.maximum(0, x)

    def _sigmoid(self, x):
        return 1 / (1 + np.exp(-x))

    def forward(self, x: np.ndarray) -> np.ndarray:
        """
        –ü—Ä—è–º–æ–µ —Ä–∞—Å–ø—Ä–æ—Å—Ç—Ä–∞–Ω–µ–Ω–∏–µ: –≤–∑–≤–µ—à–µ–Ω–Ω–∞—è —Å—É–º–º–∞ + –∞–∫—Ç–∏–≤–∞—Ü–∏—è.
        x: –≤—Ö–æ–¥–Ω—ã–µ –¥–∞–Ω–Ω—ã–µ (–≤–µ–∫—Ç–æ—Ä —Ä–∞–∑–º–µ—Ä–Ω–æ—Å—Ç–∏ input_size)
        –í–æ–∑–≤—Ä–∞—â–∞–µ—Ç –≤—ã—Ö–æ–¥ –Ω–µ–π—Ä–æ–Ω–∞.
        """
        z = np.dot(self.weights, x) + self.bias
        return self.activation(z)

# –ü—Ä–∏–º–µ—Ä –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏—è
if __name__ == "__main__":
    # –†–∞–∑–º–µ—Ä –≤—Ö–æ–¥–Ω–æ–≥–æ –≤–µ–∫—Ç–æ—Ä–∞ (–Ω–∞–ø—Ä–∏–º–µ—Ä, embedding —Ç–æ–∫–µ–Ω–∞)
    input_size = 10
    neuron = Neuron(input_size, activation='sigmoid')

    # –°–ª—É—á–∞–π–Ω—ã–π –≤—Ö–æ–¥
    x = np.random.randn(input_size)

    # –í—ã—á–∏—Å–ª—è–µ–º –≤—ã—Ö–æ–¥ –Ω–µ–π—Ä–æ–Ω–∞
    output = neuron.forward(x)
    print(f"–í—Ö–æ–¥: {x}\n–í—ã—Ö–æ–¥ –Ω–µ–π—Ä–æ–Ω–∞: {output}")
